import  Navbar  from "../../Componentes/Navbar";
import imgallison from "../../imagens/img-allison.jpg";
import imgjoana from "../../imagens/img-joana.jpg";
import imgtacila from "../../imagens/img-tacila.jpg";
import imgthaisy from "../../imagens/img-thaisy.jpg";

function Projeto () {
    return (
        <>

        <Navbar/>

        <body style={{backgroundColor:'#dfe8ff'}}>

            <div className="container ">

                <div className="row" style={{padding: '20px 0'}}>

                    <div className="col-lg-5 col-md-12 col-sm-12" style={{margin: '0 auto', backgroundColor:'red'}}>
                        <img src= {imgtacila} style={{ height: '45px' }}/>
                    </div>

                    <div className="col-lg-7 col-md-12 col-sm-12" style={{margin: '0 auto' , background:'green'}}>
                        <h2>CONECT ETE PE</h2>
                        <h2>CONECT ETE PE</h2>
                    </div>

                </div>


                <div className="row text-center justify-content-center">
                    <h2 id="hazul">Entre em contato com a gente!</h2>
                </div>


            </div>
        </body>

    
      
        </>
    )
}

export default Projeto;
